import React from 'react'
import Footer from '../components/Footer'
import './Project.css'

class Body extends React.Component {
    render() {
        return (
            <div className="Proj-body">

            </div>
        )
    }
}
class Project extends React.Component {
    render() {
        return (
            <div className="App">
                <Body></Body>
                <Footer></Footer>
            </div>
        )
    }
}

export default Project;
